// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navigation from './components/Navigation'; // Primjer poddirektorija 'components'
import ONama from './components/ONama';
import Ishrana from './components/Ishrana';
import Trening from './components/Trening';


const App = () => {
  return (
    <Router>
      <div>
        <Navigation />
        <Switch>
          <Route exact path="/o-nama" component={ONama} />
          <Route exact path="/ishrana" component={Ishrana} />
          <Route exact path="/trening" component={Trening} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
